WITH posts
AS
(
    SELECT topic_id, MAX(posted_on) AS posted_on
    FROM forums.posts
    GROUP BY topic_id
)

UPDATE forums.topics
SET last_post_on = forums.topics.created_on;

ALTER TABLE forums.topics
ADD CONSTRAINT topics_first_post_id_fkey FOREIGN KEY (first_post_id)
REFERENCES forums.posts;


CREATE FUNCTION get_last_ip(_user_id integer)
RETURNS text
AS
$$
BEGIN
    RETURN ip_address
    FROM forums.posts
    WHERE ip_address != ''
    AND posted_by = _user_id
    ORDER BY posted_on DESC
    LIMIT 1;
END
$$
LANGUAGE plpgsql;

UPDATE account.users
SET last_ip = get_last_ip(user_id);

DROP FUNCTION get_last_ip(_user_id integer);

